import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

// Generate Order Data
function createData(name, group, lastSeen, temp) {
  return { name, group, lastSeen, temp };
}

const rows = [
  createData('Node1', 'Tomaten', '3 mins ago', 20.3),
  createData('Node2', 'Graan', '5 mins ago', 20.5),
  createData('Node3', 'Tomaten', 'just now', 21.3),
  createData('Node4', 'Komkommer', 'just now', 20.4),
  createData('Node5', 'Bruce Springsteen', '1 hour ago', 21.5),
];

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles(theme => ({
  seeMore: {
    marginTop: theme.spacing(3),
  },
}));

export default function NodeTable() {
  const classes = useStyles();
  return (
    <React.Fragment>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Ship To</TableCell>
            <TableCell align="right">Temp</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(row => (
            <TableRow key={row.name}>
              <TableCell>{row.group}</TableCell>
              <TableCell>{row.lastSeen}</TableCell>
              <TableCell align="right">{row.temp}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <div className={classes.seeMore}>
        <Link color="primary" href="#" onClick={preventDefault}>
          Add nodes
        </Link>
      </div>
    </React.Fragment>
  );
}
